import React from 'react';
import css from "../styles/main.scss";

const MobileIndex = () => {
  return (
    <div className={css.stratingPlayMobile}>
      <div className={css.stratingPlayMobile_1st}>
        <div className={css.play01} style={{'background':'images/mobile/index/BGPic01.png'}}>
        </div>
        <div className={css.play02}>
          <img src="images/mobile/index/BGPic02.png" alt="" className="img-responsive"/>
          <img src="images/mobile/index/BGPic02.png" alt="" className="img-responsive"/>
        </div>
      </div>
      <div className={css.stratingPlayMobile_2nd}>
        <img src="images/mobile/index/BGPic04.png" alt="" className="img-responsive"/>
        <img src="images/mobile/index/BGPic05.png" alt="" className="img-responsive"/>
      </div>
    </div>
  );
}

export default MobileIndex;
